import React from 'react'

function ExtractCsvTable(items) {
    console.log(items.tableData)
    let data = items.tableData ? items.tableData: [];
    let column = [];
    if(data.length > 0){
        column = Object.keys(data[0])
    }

    function checkMandatoryFields(item) {
        console.log(item)
        if(item === "" || item === null){
            return "Invalid"
        }
    }

    return (
        <>
          <table>
              <thead>
                  <tr>
                {column.map((item,index)=>{
                    return(
                        <th key={index}>{item}</th>
                    )
                })}
                </tr>
              </thead>
              <tbody>
         {data.map((item,index)=>{
              return ( 
                <tr key={index}>
                <td key={index+"-username"}>{checkMandatoryFields(item.username)}</td>
                <td key={index+"-fname"}>{item.first_name}</td>
                <td key={index+"-lname"}>{item.last_name}</td>
                <td key={index+"-email"}>{checkMandatoryFields(item.email)}</td>
                <td key={index+"-phone"}>{item.phone}</td>
                </tr>
              )
            })}
            </tbody>
            </table>
        </>
    )
}

export default ExtractCsvTable
